import React, { Component } from 'react'

export default class Postform extends Component {
	constructor(props) {
		super(props);
		this.state = {
			title: '',
			body: ''
		};
	}
	render() {
		return (
			<>
				<h1>Add Posts</h1>
				<form>
					<div>
						<label>Title</label><br />
						<input type="text" name="title" value={this.state.title} />
					</div>
					<div>
						<label>Body</label><br />
						<textarea type="text" rows="3" name="body" value={this.state.body} />
					</div>
				</form>
			</>
		)
	}
}
